import React from "react";
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { FaUserAlt } from "react-icons/fa";
import { MdDynamicFeed } from "react-icons/md";
import { IoLogOut } from "react-icons/io5";

const Container = styled.div`
    display: flex;
    flex-direction: column;
    position: fixed;
    left: 0;
    height: 100vh;
    margin: 15px;
    margin-top: 150px;
`;

const StyledLink = styled(Link)`
    color: #fff;
    padding: 15px;
    text-decoration: none;
    font-weight: bold;
    margin: 15px;
    font-size: 20px;
    background-color: #64b3cc;
    border-radius: 20px; 
    display: flex;
    align-items: center;
    justify-content: center;
`;

const SidebarContainer = styled.section`
    display: flex;
    flex-direction: column;
    width: 250px;
    background-color: #2c3e50;
    height: 100vh;
    padding-top: 100px;
`;

const UserContainer = styled.div`
    display: flex;
    align-items: center;
    padding: 20px;
    border-bottom: 1px solid #fff;
`;

const UserAvatar = styled.img`
    border-radius: 50%;
    width: 50px;
    height: 50px;
    margin-right: 10px;
`;

const UserInfo = styled.div`
    color: #fff;
`;

const UserName = styled.span`
    display: block;
    font-weight: bold;
`;

const UserDetail = styled.span`
    display: block;
`;

const MenuItems = styled.ul`
    list-style: none;
    padding: 0;
`;

const MenuItem = styled.li`
    margin: 10px 0;
`;

const MenuLink = styled(Link)`
    color: #fff;
    text-decoration: none;
    padding: 15px;
    display: flex;
    align-items: center;
    background-color: #34495e;
    border-radius: 10px;

    &:hover {
        background-color: #1abc9c;
    }
`;

const MenuIcon = styled.i`
    margin-right: 10px;
`;

function NavBar() {
    return (
        <SidebarContainer className="corpo-principal2">
            <div className="conteudo-geral2">
                <nav className="sidebar">
                    <div className="sidebar-conteudo">
                        <UserContainer className="user">
                            <UserAvatar src="img/avatar.jpg" alt="avatar" />
                            <UserInfo className="informação-do-usuario">
                                <UserName className="items-description">Nome Usuario</UserName>
                                <UserDetail className="items-description">Lorem ipsum</UserDetail>
                            </UserInfo>
                        </UserContainer>
                        <MenuItems className="items-sdb">
                            <MenuItem className="items-sidebar active">
                                <MenuLink to="#">
                                    <MenuIcon className="fa-solid fa-user" />
                                    <span className="items-description">Perfil</span>
                                </MenuLink>
                            </MenuItem>
                            <MenuItem className="items-sidebar">
                                <MenuLink to="#">
                                    <MenuIcon className="fa-solid fa-bell" />
                                    <span className="items-description">Notificações</span>
                                </MenuLink>
                            </MenuItem>
                            <MenuItem className="items-sidebar">
                                <MenuLink to="#">
                                    <MenuIcon className="fa-solid fa-gear" />
                                    <span className="items-description">Configurações</span>
                                </MenuLink>
                            </MenuItem>
                            <MenuItem className="items-sidebar">
                                <MenuLink to="#">
                                    <MenuIcon className="fa-solid fa-right-from-bracket" />
                                    <span className="items-description">Logout</span>
                                </MenuLink>
                            </MenuItem>
                        </MenuItems>
                    </div>
                </nav>
            </div>
        </SidebarContainer>
    );
}

export default NavBar;
